// Return Home 
import React from 'react';
import HOme from './Homed/Main';
import moment from 'moment';

function App() {

 var end = moment().endOf('month');
 var start = moment().startOf('month');

 React.useEffect(() => {
  window.console.log(start.format('L') + ' ' + end.format('L') + ' ' + !end.format('L'));

 }, []);

 return (
  <HOme />
 );
};

// Export component Main
export default App;
